Гости́ница, оте́ль (от фр. hôtel) — средство размещения, состоящее из определенного количества номеров, имеющее единое руководство, предоставляющее набор услуг (минимум — заправка постелей, уборка номера и санузла) и сгруппированная в классы в соответствие с предоставляемыми услугами и оборудованию номеров. Связанные с гостиницей профессии: 
* отельер — общее управление; 
* портье — встреча в приёмной и руководство расселением прибывающих; 
* горничная — уборка гостиничных номеров; 
* носильщик — переноска багажа постояльцев до/из номера.

